function r2PerfEEG = getNoiseIndex(fs, mtgLabels, dataWin)
    
    r2PerfEEG = 0;
    
    nSamples = size(dataWin,2);
    nrMtgs = size(mtgLabels,1);

    freqs = fs*(0:(nSamples/2))/nSamples;
    delSel = (freqs < 1) | (freqs > 341.33);
    dataSpctrmAllChanns = zeros(nrMtgs, length(freqs));
    channSpecR2 = zeros(nrMtgs,1);
    for mi = 1:nrMtgs
        freqs = fs*(0:(nSamples/2))/nSamples;
        signal = dataWin(mi,:);

        Y = fft(signal);
        P2 = abs(Y/nSamples);
        dataSpctrm = P2(1:nSamples/2+1);
        dataSpctrm(2:end-1) = 2*dataSpctrm(2:end-1);
        dataSpctrm = real(dataSpctrm);

        dataSpctrmAllChanns(mi,:) = dataSpctrm;

        freqs(delSel) = [];
        dataSpctrm(:,delSel) = [];
        
        dataSpctrmNormLog = rescale(log10(dataSpctrm));
        [p, S] = polyfit(freqs, dataSpctrmNormLog, 10);
        [linRegY, delta] = polyval(p, freqs, S);
        [freqsPerfEEG, logPowerPerfEEG] = getPerfEEGSingleCh_RegressionVals();
    
        r2Num = mean((logPowerPerfEEG-linRegY).^2);
        r2Denom = mean((logPowerPerfEEG-mean(linRegY)).^2);
        %r2Num = max((logPowerPerfEEG-linRegY).^2);
        %r2Denom = max((logPowerPerfEEG-mean(linRegY)).^2);

        channSpecPerfEEG_R2 = r2Num/r2Denom;

        channSpecR2(mi) = channSpecPerfEEG_R2;
    
        % subplot(2,1,1)
        % plot(freqsPerfEEG, dataSpctrmNormLog); hold on;
        % plot(freqsPerfEEG, linRegY); hold on;
        % plot(freqsPerfEEG, logPowerPerfEEG); hold on;    
        % ylabel('Power (uV^2)');
        % xlabel('Freq (Hz)')
        % legend('FFT', strcat('Current EEG (',num2str(channSpecPerfEEG_R2, '%.2f'),')'),  'Ideal EEG')
        % subplot(2,1,2)
        % plot(freqsPerfEEG, ((logPowerPerfEEG-linRegY).^2));
        % sgtitle(mtgLabels{mi})
        % close()
    end
    dataSpctrmAllChanns(:,delSel) = [];
    dataSpctrmAllChannsAvg = mean(dataSpctrmAllChanns,1);
    spctrmLogPower = rescale(log10(dataSpctrmAllChannsAvg));
    %spctrmLogPower = movmean(spctrmLogPower, length(spctrmLogPower)/20);

    [freqsPerfEEG, logPowerPerfEEG] = getPerfEEGChannAvg_RegressionVals();


    % Fit a polynom model to the averaged channels
    [p, S] = polyfit(freqs, spctrmLogPower, 34);
    % Get the polynom prediction of the averaged channels
    [linRegY, delta] = polyval(p, freqsPerfEEG, S);

    % r2Num = sum((spctrmLogPower-linRegY).^2);
    % r2Denom = sum((spctrmLogPower-mean(linRegY)).^2);
    % polyfitR2 = r2Num/r2Denom
    ssr = sum((spctrmLogPower-linRegY).^2); % Residual Sum-Of-Squares
    sst = sum((spctrmLogPower-mean(spctrmLogPower)).^2); % Total Sum-Of-Squares
    polyfitR2 = ssr/sst;

    ssr = sum((logPowerPerfEEG-linRegY).^2);
    sst = sum((logPowerPerfEEG-mean(spctrmLogPower)).^2);
    perfeegR2 = ssr/sst;
    if perfeegR2>1
        perfeegR2 = 1;
    end


    % plot(freqsPerfEEG, spctrmLogPower); hold on;
    % plot(freqsPerfEEG, linRegY); hold on;
    % plot(freqsPerfEEG, logPowerPerfEEG); hold on;    
    % ylabel('Power (uV^2)');
    % xlabel('Freq (Hz)')
    % legend('FFT', strcat('Current EEG (',num2str(polyfitR2, '%.2f'),')'),  strcat('Ideal EEG (',num2str(perfeegR2, '%.2f'),')'))
    % close();

    r2PerfEEG = NaN;
    if nrMtgs >= 10
        r2PerfEEG = (perfeegR2+polyfitR2)/2;
    end
end

function r2PerfEEG = getNoiseIndexSingleChanns(fs, mtgLabels, dataWin)
    
    r2PerfEEG = 0;
    
    %return;

    nSamples = size(dataWin,2);
    nrMtgs = size(mtgLabels,1);

    freqs = fs*(0:(nSamples/2))/nSamples;
    delSel = (freqs < 1) | (freqs > 500);
    dataSpctrmAllChanns = zeros(nrMtgs, length(freqs));
    channSpecR2 = zeros(nrMtgs,1);
    for mi = 1:nrMtgs
        freqs = fs*(0:(nSamples/2))/nSamples;
        signal = dataWin(mi,:);

        Y = fft(signal);
        P2 = abs(Y/nSamples);
        dataSpctrm = P2(1:nSamples/2+1);
        dataSpctrm(2:end-1) = 2*dataSpctrm(2:end-1);
        dataSpctrm = real(dataSpctrm);

        dataSpctrmAllChanns(mi,:) = dataSpctrm;

        freqs(delSel) = [];
        dataSpctrm(:,delSel) = [];
        
        dataSpctrmNormLog = rescale(log10(dataSpctrm));
    
        [p, S] = polyfit(freqs, dataSpctrmNormLog, 10);
        [linRegY, delta] = polyval(p, freqs, S);
        [freqsPerfEEG, logPowerPerfEEG] = getPerfEEGSingleCh_RegressionVals();
    
        nrSampsMA = ceil(length(dataSpctrmNormLog)/100);
        dataSpctrmNormLog = movmean(dataSpctrmNormLog, nrSampsMA);
        r2Num = max((logPowerPerfEEG-dataSpctrmNormLog).^2);
        r2Denom = max((logPowerPerfEEG-mean(dataSpctrmNormLog)).^2);
        %r2Num = max((logPowerPerfEEG-linRegY).^2);
        %r2Denom = max((logPowerPerfEEG-mean(linRegY)).^2);

        channSpecPerfEEG_R2 = r2Num/r2Denom;

        channSpecR2(mi) = channSpecPerfEEG_R2;
    
        %plot(freqsPerfEEG, spctrmLogPower); hold on;
        subplot(2,1,1)
        plot(freqsPerfEEG, dataSpctrmNormLog); hold on;
        plot(freqsPerfEEG, linRegY); hold on;
        plot(freqsPerfEEG, logPowerPerfEEG); hold on;    
        ylabel('Power (uV^2)');
        xlabel('Freq (Hz)')
        legend('FFT', strcat('Current EEG (',num2str(channSpecPerfEEG_R2, '%.2f'),')'),  'Ideal EEG')
        subplot(2,1,2)
        plot(freqsPerfEEG, ((logPowerPerfEEG-linRegY).^2));
        sgtitle(mtgLabels{mi})
        close()
    end
    dataSpctrmAllChanns(:,delSel) = [];
    dataSpctrmAllChannsAvg = mean(dataSpctrmAllChanns,1);
    spctrmLogPower = rescale(log10(dataSpctrmAllChannsAvg));

    [p, S] = polyfit(freqs, spctrmLogPower, 10);
    [linRegY, delta] = polyval(p, freqs, S);
    [freqsPerfEEG, logPowerPerfEEG] = getPerfEEGChannAvg_RegressionVals();
    
    r2Num = sum((logPowerPerfEEG-linRegY).^2);
    r2Denom = sum((logPowerPerfEEG-mean(linRegY)).^2);
    r2PerfEEG = r2Num/r2Denom;

    plot(freqsPerfEEG, spctrmLogPower); hold on;
    plot(freqsPerfEEG, linRegY); hold on;
    plot(freqsPerfEEG, logPowerPerfEEG); hold on;    
    ylabel('Power (uV^2)');
    xlabel('Freq (Hz)')
    legend('FFT', strcat('Current EEG (',num2str(channSpecPerfEEG_R2, '%.2f'),')'),  'Ideal EEG')
    close();
end

function r2PerfEEG = getNoiseIndexLevelA(fs, mtgLabels, dataWin)
    
    nSamples = size(dataWin,2);
    nrMtgs = size(mtgLabels,1);

    freqs = fs*(0:(nSamples/2))/nSamples;
    delSel = (freqs < 1) | (freqs > abs(fs/3));
    dataSpctrmAllChanns = zeros(nrMtgs, length(freqs));
    for mi = 1:nrMtgs
        freqs = fs*(0:(nSamples/2))/nSamples;
        signal = dataWin(mi,:);

        Y = fft(signal);
        P2 = abs(Y/nSamples);
        dataSpctrm = P2(1:nSamples/2+1);
        dataSpctrm(2:end-1) = 2*dataSpctrm(2:end-1);

        dataSpctrmAllChanns(mi,:) = dataSpctrm;
    end

    freqs(delSel) = [];
    dataSpctrmAllChanns(:,delSel) = [];
    spctrmLogPower = rescale(log10(mean(dataSpctrmAllChanns,1)));

    [p, S] = polyfit(freqs, spctrmLogPower, 10);
    [linRegY, delta] = polyval(p, freqs, S);
    [freqsPerfEEG, logPowerPerfEEG] = getPerfEEG_RegressionVals();

    r2Num = sum((logPowerPerfEEG-spctrmLogPower).^2);
    r2Denom = sum((logPowerPerfEEG-mean(spctrmLogPower)).^2);
    r2PerfEEG = r2Num/r2Denom;

    %plot(freqs, spctrmLogPower); hold on;
    %plot(freqs, y1); hold on;
    % plot(freqsPerfEEG, logPowerPerfEEG); hold on;    
    % ylabel('Power (uV^2)');
    % xlabel('Freq (Hz)')
    % legend('Current EEG',  'Ideal EEG')
    % close();
end

